# The subsurface method is used to obtain a "subsurface" of a larger surface. A subsurface is a reference to a rectangular part 
# of the original surface, and operations performed on the subsurface will directly affect the original surface. 
# This can be useful for manipulating specific parts of an image or for dividing a surface into smaller regions.

# "subsurface" has the same parameters as a pg.Rect, which are "left, top, width, height". 
# In this case I uploaded a 63x65 pixel image of a cat.

# Creating a subsurface with the values ​​(1,0,63,65) will not be possible since starting at coordinate 1 and drawing 
# 63 pixels further to the right will cause the measurements (only the width in this case) 
# of the subsurface to be greater than the original image (63 pixels width), therefore, those values ​​will give an error.

# The formula to avoid the error is: 
# l+w<=W & t+w<=H

# The lowercase letters being the values ​​for the subsurface (l,t,w,h), "W" the width of the original image 
# and "H" the height of the original image.

