s = create_cat()
s_ = s.get_rect(center = screen_.center)

# subsurfaces
tail = s.subsurface(46,33,17,30)
head = s.subsurface(0,0,55,35)
body = s.subsurface(12,35,36,28)
tail_ = tail.get_rect(topleft=(s_.left + 48, s_.top + 33))
head_ = head.get_rect(topleft=s_.topleft)
body_ = body.get_rect(topleft=(s_.left + 12, s_.top + 35))

# function to create some texts easily
f = pg.font.SysFont('centurygothic', 25)
def ftxt(text:str, key='topleft', ref='screen_.topleft', color='white', bgcolor=None): 
    s = f.render(text, True, color, bgcolor=bgcolor)
    r = s.get_rect()
    exec(f"r.{key} = {ref}")
    return (s,r)

txt, txt_ = ftxt('Click on the cat', 'midtop', (screen_.centerx, screen_.top+screen_.h//6))
txt2, txt2_ = ftxt('Press 1 to see the hitboxes', 'midbottom', (screen_.centerx, screen_.bottom-screen_.h//6))

visible_hitboxes = False

# Game loop
running = True
while running:
    for event in pg.event.get():
        if event.type == QUIT:
            running = False
        if event.type == KEYDOWN:
            if event.key == K_ESCAPE:
                running = False
            elif event.key == K_1:
                visible_hitboxes = not visible_hitboxes
        if event.type == MOUSEBUTTONDOWN:
            if event.button == 1:
                if tail_.collidepoint(event.pos):
                    print('meow?')
                elif head_.collidepoint(event.pos):
                    print('purrrr...')
                elif body_.collidepoint(event.pos):
                    print('hissss')
                
    screen.fill('grey8')
    screen.blit(s, s_)
    screen.blit(txt, txt_)
    screen.blit(txt2, txt2_)

    if visible_hitboxes:
        pg.draw.rect(screen, (255, 0, 0), tail_, 2)
        pg.draw.rect(screen, (0, 255, 0), head_, 2)
        pg.draw.rect(screen, (0, 0, 255), body_, 2)
    pg.display.flip()

pg.quit()
